import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { blue } from '@material-ui/core/colors';
import Drone from '../../pictures/drone.png';





const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      backgroundColor: 'gray',
      height: '300px'
    },
  }));

  export default function UserInfo() {
    const classes = useStyles();

    return (
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={6} >
            <h1 style = {{textAlign: 'left', padding: '10px', fontWeight : "bold"}}>Welcome to your Dashboard</h1>
            <div style = {{display: 'flex', alignItems : 'center'}}>
             <img src={Drone} style ={{width : 200, paddingLeft: '50px', paddingTop: '20px'}}/>
             <div style = {{paddingLeft: "30px"}}>
             <h1>Canada Drone Company </h1>
             <h3>Check below for analytics</h3>
             </div>

            </div>

          </Grid>
          <Grid item xs={6} >
            <Paper className={classes.paper} >xs=12</Paper>
          </Grid>

        </Grid>
      </div>
    );
  }
